import React, {Component} from 'react';
import "../style/bootstrap.min.css";
import "../style/reviewHome.css"
// import { Link } from "react-router-dom";

class ReviewHome extends Component{
    render(){
        return(
            <div>
                <div className="container">
                    <div className="row">
                        <div className="col-md-6 home-review1">
                            <p className="user-review">Pelanggan Puas</p>
                            <hr/>
                            <img src={require("../image/agung.JPG")} alt=""/>
                            <p className="rating">7 / 10</p>
                            <p className="message">pesan orang</p>
                        </div>
                        <div className="col-md-6 home-review2">
                            <p>Pelanggan Puas</p>
                            <hr/>
                            <img src="" alt=""/>
                            <p>7 / 10</p>
                            <p>pesan orang</p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default ReviewHome;
